import React from 'react'
import { useNavigate } from 'react-router-dom'

export default function Home() {
  const navigate = useNavigate()

  const onSubscriptClick = () => {
    navigate('/subscriptions')
  }

  const onRequestClick = () => {
    navigate('/request')
  }

  const onFutureClick = () => {
    navigate('/future')
  }

  const onScheduleClick = () => {
    navigate('/schedule')
  }

  const onHistoryClick = () => {
    navigate('/history')
  }

  return (
    <div className={'mainContainer'}>
      <div className={'inputContainer'}>
        <input className={'homeButton'} type="button" onClick={onSubscriptClick} value={'My Jarvis Subscription'} />
      </div>

      <div className={'inputContainer'}>
        <input className={'homeButton'} type="button" onRequestClick={onRequestClick} value={'Request a Ride Now'} />
      </div>

      <div className={'inputContainer'}>
        <input className={'homeButton'} type="button" onClick={onFutureClick} value={'Request a Ride in the Future'} />
      </div>

      <div className={'inputContainer'}>
        <input className={'homeButton'} type="button" onClick={onScheduleClick} value={'View Scheduled Rides'} />
      </div>

      <div className={'inputContainer'}>
        <input className={'homeButton'} type="button" onClick={onHistoryClick} value={'Ride History'} />
      </div>
    </div>
  )
}
